import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';


export default function AppNewsletter () {
    return (
        <section className='newsletter'>

        <Container>

        <Row>




        <Col sm={5}>
           <h1 className='heading3'>Save Time & Money with Automated Payroll</h1>
           <p className='longtext3'>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text.Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text.</p>

         </Col>

         <Col sm={7}>
            <InputGroup className="search">
                <Form.Control id="basic-url" aria-describedby="basic-addon3" />
                <InputGroup.Text id="basic-addon3">Search</InputGroup.Text>
            </InputGroup>

      </Col>



      </Row>

        </Container>

        </section>
    )
}
